import { makeStyles } from "@material-ui/core/styles";
import { TextField } from "@material-ui/core";
import CardUI from "../UI/CardUI";

const useStyles = makeStyles((theme) => {


});

const AddUser = () => {
  return (
    <CardUI>
      <form>
        <TextField
          type="text"
          id="outlined-basic"
          label="Username"
          variant="outlined"
          className={classes.input}
        />
        <TextField
          type="number"
          id="outlined-basic"
          label="Age(Years)"
          variant="outlined"
        />
      </form>
    </CardUI>
  );
};

export default AddUser;
